function calcularTiempo(){var a=$("#sueldoN").val(),b=16.05,c=75e9/(a/b)/12;$("#resultado").text(Math.floor(c))}function mostrar(){$("#resultadobox").hasClass("no-display")&&$("#resultadobox").removeClass("no-display")}$(document).ready(function(){$("#calcular").click(function(){calcularTiempo(),mostrar()})});